        <input type={"number"} id="L" placeholder="L" />
        <input type={"number"} id="M" placeholder="M" />
        <input type={"number"} id="N" placeholder="N" />
        <input type={"number"} id="O" placeholder="O" />
        <input type={"number"} id="P" placeholder="P" />
        <input type={"number"} id="Q" placeholder="Q" />
        <input type={"number"} id="R" placeholder="R" />
        <input type={"number"} id="S" placeholder="S" />
        <input type={"number"} id="T" placeholder="T" />
      </form>
      <form className="inputConteinetBTN" >
      <button className="inpButton">გამოთვლა</button>
      </form>
      </div>
      <div className="chartGraphs">
        <div className="BarChartAll">
          <BarChart sabolooMoxmareba={props.sabolooMoxmareba} />
        </div>
        <div className="BarChartAll">
          <Sxvaoba sabolooMoxmareba={props.sabolooMoxmareba} />
        </div>
      </div>
    </div>
  );
}

export default MainPage;
